const displayReducer = (state = ['display', 'mainMenu'], action) => {
  let className;
  switch (action.type) {
    case 'SET_DISPLAY':
      console.log(action.payload);

      state.forEach((item) => {
        console.log(item);
      });
      return;
    default:
      return state;
  }
};

export default displayReducer;
